def select_project():
	flag = v.get()
	if flag == 2:
		temp = ["ALL"]
		cmb_branch_list['value'] = temp
	else : 
		global select_project
		select_project = var_project.get()
		Branch_list.clear()
		if 'ALL' in select_project:
			Branch_list.append('ALL')
		else:
			global select_project_id
			for i  in range(len(ProjectName_list)):
				if select_project in ProjectName_list[i]:
					select_project_id = str(ProjectId_list[i])
			project_url = "http://10.52.131.182/api/v4/projects/"+select_project_id+"/repository/branches?private_token=" + private_token
			r = requests.get(project_url)
			data = r.json()
			for i in data:
				Branch_list.append(i['name'])
			Branch_list.append("ALL")
		cmb_branch_list['value'] = Branch_list

def PrecisionSearch():
	filepath = var_file_name.get()
	filepath.replace("/","%2F")
	Keyword = var_keyword.get()
	select_branch = var_branch.get()
	global select_project_id
	url = 'http://git.sami.int.thomsonreuters.com/api/v4/projects/'+select_project_id+'/repository/files/'+filepath+'?private_token='+private_token+'&ref='+select_branch
	header = { 'user-agent' : 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.88 Safari/537.36'}
	data = None
	req = request.Request(url, headers=header)
	res = request.urlopen(req)
	htmlfile = res.read()
	sourcefile = htmlfile.decode("utf-8")
	pattern = 'blob_id*"(.+?)",'
	select_blob = re.findall(pattern,sourcefile)
	if select_blob == []:
		pattern = 'blob_id=>"(.+?)",'
		select_blob = re.findall(pattern,sourcefile)
	select_blob = "".join(filter(str.isalnum , select_blob[0]))
	url = 'http://git.sami.int.thomsonreuters.com/api/v4/projects/'+select_project_id+'/repository/blobs/'+select_blob+'/raw?private_token='+private_token
	req = request.Request(url, headers=header)
	res = request.urlopen(req)
	htmlfile = res.read()
	sourcefile = htmlfile.decode("utf-8")
	flag = 0
	for eachline in sourcefile.split('\n'):
		if Keyword in eachline:
			text.insert("end" , eachline+"\n")
			flag = 1
	if flag == 0:
		print("Can not find " + Keyword)

def searchfile(script_path , project_name , file_name ,keyword , branch_name):
	flag_all = 0
	for root,dirs,files in os.walk(script_path + '/' + project_name + '/'):
	        for file in files:
	           if re.findall(file_name , file) != []:
	           	filepath = root +'/'+ os.path.join(file)
	           	if '.git' in filepath:
	           		continue
	           	try:
	           		f=open(filepath, encoding="utf8")
	           		content = f.read()
	           		flag = 0
	           		for eachline in content.split('\n'):
	           			if re.findall(keyword , eachline) != []:
	           				text.insert("end" , eachline+"\n")
	           				flag = 1
	           				flag_all = 1
	           		f.close()
	           		if flag  == 1:
	           			printpath=(root +'/'+os.path.join(file)).split('gitlab_search/')[1]
	           			text.insert("end" , branch_name+'--'+printpath+"\n")
	           	except:
	           		try:
	           			f=open(filepath)
	           			content = f.read()
	           			flag = 0
	           			for eachline in content.split('\n'):
	           				if re.findall(keyword , eachline) != []:
	           					text.insert("end" , eachline+"\n")
	           					flag = 1
	           					flag_all = 1
	           			f.close()
	           			if flag  == 1:
	           				printpath=(root +'/'+os.path.join(file)).split('gitlab_search/')[1]
	           				text.insert("end" , branch_name+'--'+printpath+"\n")
	           		except:
	           			text.insert("end" , "WRONG:"+(root +'/'+os.path.join(file)).split('gitlab_search/')[1]+'\n')
	if flag_all == 0:
		text.insert("end" , project_name+'/'+branch_name+"/No Result\n")

def search_project_all_branch(access_token , script_path , project_path , file_name , keyword , project_name):
	#if '_venue' in project_name:
	#	cmd1='git clone http://oauth2:'+access_token +'@git.sami.int.thomsonreuters.com/thunderdome_puppet_components/'+ project_name+'.git'
	#else:	
	#	cmd1 = 'git clone http://oauth2:'+access_token +'@git.sami.int.thomsonreuters.com/thunderdome_venues/'+ project_name+'.git'
	cmd1='git clone http://oauth2:'+access_token +'@'+ project_path.split('ttps://')[1]
	a=os.system(cmd1)
	if a ==0:
		cmd2 = 'cd '+ project_name
		cmd3 = 'git branch -a'
		cmd = cmd2 + '&&' +cmd3
		output = os.popen(cmd).read()
		output_list = output.split('\n')
		branch_list = output_list[2:len(output_list)-1]
		#print(branch_list)
		#searchfile(script_path , project_name , file_name ,keyword , 'master')
		for each_branch in branch_list:
			branch_name = each_branch.split('origin/')[1]
			origin_branch_name = each_branch.split('remotes/')[1]
			cmd4 = 'git checkout -b '+ branch_name+'duplicate '+ origin_branch_name
			if (os.system(cmd2+"&&"+cmd4) == 0) :
				searchfile(script_path , project_name , file_name ,keyword , branch_name)
	os.system('rm -rf ' + project_name)

